          <Nav.Link href="/today">Today</Nav.Link>
          <Nav.Link href="/forecast">Forcast</Nav.Link>
        </Nav>
      </Container>
  </Navbar>*/
    <Navbar bg="light" sticky="top">
      <Container>
        <Navbar.Brand>WeatherMood</Navbar.Brand>
        <Nav className="me-auto">
          <div className="navItem" onClick={setShowToday(true)}>
            Today
          </div>
          <div className="navItem" onClick={setShowToday(false)}>
            Forcast
          </div>
        </Nav>
      </Container>
    </Navbar>
  );
}

export default Mynavbar;
